import React, { Component } from 'react'
import ResearchDetails from '../Utils/ResearchDetails'
import ListGroup from 'react-bootstrap/ListGroup'
export class ProcessResearchCards extends Component {

    constructor(props) {
        super(props);
        this.researchDetails=ResearchDetails.details;
    }

    render() {
        this.renderr=this.researchDetails.map((details) => (
            <ListGroup horizontal={details} className="my-2" key={details.id}>
            <ListGroup.Item><ResearchCard/></ListGroup.Item>
            </ListGroup>
        ))
        return (
            <div>
                {this.renderr}
            </div>
        )
    }
}

export default ProcessResearchCards
